import React from 'react';
import MediaItem from '../MediaItem'

const News = () => {
	return (
		<div>
			<MediaItem 
				MediaTitle="title" 
				MediaDate="date"
				MediaContent="content" 
			/>
		</div>

	);
};

export default News;
